import { useContext } from "react";

import Card from "../UI/Card";
import { BudgetContext } from "../context/budget-context";

const Budget = () => {
    const budgetCtx = useContext(BudgetContext);

    return <div>
        <Card>
            <span>Budget ${budgetCtx}</span>
        </Card>
    </div>
};

export default Budget;
